    "2013-03-16T00:08:38.653467",nt"name": "lists-and-analyses-of-the-mineral-springs-of-the-united-states-1886",nt"isopen":
    false,nt"url": null,nt"notes": "Bulletin compiling mineral springs statistics
    of the United States. In attempting the collection of data for the statement of
    the commercial value of the mineral waters of the country for publication iu the
    report on the Mineral Resources of the United States, 1883 and 1884, it was necessary
    as prerequisite to have a list of the springs from which these waters are derived.
    An examination of the few general works on the subject very soon showed that all
    existing lists were incomplete. The tables given in this paper were therefore compiled,
    as the first step in the preparation of the mineral spring statistics of the. United
    States, They were omitted from the paper published in Mr. Williams's report, for
    want of space. Since the appearance of that report they have been revised and, with
    the addition of such analyses as could be obtained, prepared for publication as
    a bulletin of the Survey.",nt"license_title": null,nt"extras": [{ntt"key":
